import React, { useContext } from 'react';
import {
    BrowserRouter as Router,
    Switch,
    Route,
    Redirect
} from 'react-router-dom';

import Teste from './../pages/Teste';
import LoginEstabelecimento from './../pages/LoginEstabelecimento';
import AuthEstabelecimentoContext from './../contexts/auth-estabelecimento';

const PrivateRoute = ({ component: Component, ...rest }) => {
    const { signed } = useContext(AuthEstabelecimentoContext);

    return (
        <Route
            {...rest}
            render={() => signed
                ? <Component {...rest} />
                : <Redirect to="/login" />}
        />
    );
};

const EstabelecimentoRoutes = () => (
    <Router>
        <Switch>
            <Route path="/" component={Teste} exact />
            <PrivateRoute path="/login" component={LoginEstabelecimento} />
        </Switch>
    </Router>
);

export default EstabelecimentoRoutes;
